import React,{Component} from 'react';
import "semantic-ui-css/semantic.min.css";
import{
  Grid,
  Form,
  Button,
  Checkbox,
  Header,
  Image,
  Icon
}from "semantic-ui-react";

class App extends Component {
  render(){
    return (
      <div>
        <br /><br/><br /> <br /><br />
        <Grid container columns={3}>
          <Grid.Column width={6}>
          </Grid.Column>
          <Grid.Column>
            <Form>
              <Header as="h3" color="teal" inline>
                <Image src="https://s3-ap-southeast-1.amazonaws.com/niomic/img-v1/c_login_logo.png"/>
                Member Login
              </Header>
              <Form.Field>
                <input type="text" placeholder="E-mail address" icon={<Icon name="user"/>}/>
              </Form.Field>
            </Form>
          </Grid.Column>
          <Grid.Column>
          </Grid.Column>
        </Grid>

      </div>
    );
  }
}

export default App;
